import {useState} from "react";
import {Routes,Route} from 'react-router-dom';

import BookingPage from './BookingPage.js';
import HomePage from './HomePage.js'

//handles state change for 'availableTimes' state based on the date selected by the user
function updateTimes(){

}
function Main(){
    //state variable for available times:
    const [availableTimes] = useState([
        '17:00',
        '18:00',
        '19:00',
        '20:00',
        '21:00',
        '22:00',
    ])

    return(
        <main>
        <Routes>
            <Route path='/' element={<HomePage/>} ></Route>
            <Route path='/booking' element={<BookingPage availableTimes={availableTimes} onAddTimes={updateTimes}/>}></Route>
        </Routes>
        </main>
    )
}

export default Main
